import React, { useState, useEffect } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import axios from 'axios';
import './BookPickup.css';

const BookPickup = () => {
  const [pickupLocation, setPickupLocation] = useState('');
  const [selectedDate, setSelectedDate] = useState(null);
  const [timeSlot, setTimeSlot] = useState('');
  const [confirmation, setConfirmation] = useState(false);
  const [cartItems, setCartItems] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(''); // Error handling state

  useEffect(() => {
    const fetchCartDetails = async () => {
      setIsLoading(true);
      try {
        // Get the cartId from the URL query parameters
        const urlParams = new URLSearchParams(window.location.search);
        const cartId = urlParams.get('cartId');

        // Check if cartId exists
        if (!cartId) {
          throw new Error('Cart ID is missing in the URL.');
        }

        console.log('Fetching cart details for cartId:', cartId); // Debugging

        // Fetch the cart details using the cartId
        const response = await axios.get(`/api/cart/${cartId}`);
        console.log('Cart details fetched:', response.data); // Debugging

        // Check if the response contains cart items
        if (!response.data || !response.data.items || response.data.items.length === 0) {
          throw new Error('No items found in the cart.');
        }

        setCartItems(response.data.items); // Set cart items
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching cart details:', error.message || error);
        setError(error.message || 'Failed to load cart details.'); // Set error message
        setIsLoading(false);
      }
    };

    fetchCartDetails();
  }, []);

  const handleSchedulePickup = async () => {
    if (pickupLocation && selectedDate && timeSlot) {
      try {
        const urlParams = new URLSearchParams(window.location.search);
        const cartId = urlParams.get('cartId');  // Get the cartId from URL query params

        const user = JSON.parse(localStorage.getItem('user'));
        await axios.post('/api/pickup/schedule', {
          cartId,
          email: user.email,
          pickupDate: selectedDate,
          pickupTime: timeSlot,
          pickupLocation: pickupLocation
        });
        setConfirmation(true);
      } catch (error) {
        console.error('Error scheduling pickup:', error);
      }
    } else {
      alert('Please select all options before proceeding.');
    }
  };

  if (isLoading) return <p>Loading cart details...</p>;
  if (error) return <p>{error}</p>; // Display error if any

  return (
    <div className="book-pickup-container">
      {!confirmation ? (
        <div>
          <h2>Schedule Book Pickup</h2>

          {cartItems ? (
            <>
              <h3>Your Order Summary</h3>
              <ul>
                {cartItems.map(item => (
                  <li key={item._id}>
                    <strong>{item.title}</strong><br/>
                    <img src={item.image} alt={item.title} style={{ width: '100px', marginBottom: '10px' }} /><br/>
                    <span>Publication: {item.publication}</span><br/>
                    <span>Standard: {item.standard}</span><br/>
                    <span>Publication Year: {item.publication_year}</span><br/>
                    <span>Description: {item.description}</span><br/>
                    <hr/>
                  </li>
                ))}
              </ul>
            </>
          ) : (
            <p>No items found in your cart.</p> // Fallback if cartItems is empty or null
          )}

          <label>
            Select Pickup Location:
            <select value={pickupLocation} onChange={(e) => setPickupLocation(e.target.value)}>
              <option value="">Select Location</option>
              <option value="Library 1">Library 1</option>
              <option value="Library 2">Library 2</option>
              <option value="Center A">Center A</option>
              <option value="Center B">Center B</option>
            </select>
          </label>
          <br />
          <br />
          <label>
            Select Date:
            <DatePicker
              selected={selectedDate}
              onChange={(date) => setSelectedDate(date)}
              inline
              minDate={new Date()} // Prevent selecting past dates
            />
          </label>
          <br />
          <br />
          <label>
            Select Time Slot:
            <div className="time-slot-container">
              {['9:00 AM - 9:30 AM', '9:30 AM - 10:00 AM', '10:00 AM - 10:30 AM'].map((slot, index) => (
                <button
                  key={index}
                  className={`time-slot ${timeSlot === slot ? 'selected' : ''}`}
                  onClick={() => setTimeSlot(slot)}
                >
                  {slot}
                </button>
              ))}
            </div>
          </label>

          <button className="schedule-btn" onClick={handleSchedulePickup}>Schedule Pickup</button>
        </div>
      ) : (
        <div>
          <h2>Pickup Confirmation</h2>
          <p>Pickup Location: {pickupLocation}</p>
          <p>Pickup Date: {selectedDate?.toLocaleDateString()}</p>
          <p>Pickup Time: {timeSlot}</p>
          <button onClick={() => alert('Pickup Scheduled!')}>Confirm Pickup</button>
        </div>
      )}
    </div>
  );
};

export default BookPickup;
